        "import pandas as pd\n",
        "import os\n",
        "\n",
        "# --- Function to parse a single NPD summary .txt file (SUPER REVISED - Final) ---\n",
        "def parse_npd_summary_txt_super_revised(filepath):\n",
        "    \"\"\"\n",
        "    Parses a NPD Factpages well summary .txt file into a dictionary.\n",
        "    Handles 'Attribute\\\\t\\\\nValue' and 'Attribute\\\\tValue' formats more robustly.\n",
        "    \"\"\"\n",
        "    data = {}\n",
        "    content = \"\"\n",
        "    with open(filepath, 'r', encoding='utf-8') as f:\n",
        "        content = f.read()\n",
        "\n",
        "    # Normalize line endings to just '\\n' and then split into lines\n",
        "    content = content.replace('\\r\\n', '\\n').replace('\\r', '\\n')\n",
        "    lines = content.split('\\n')\n",
        "\n",
        "    # Skip the \"Attribute\\tValue\" header if it exists\n",
        "    if lines and \"Attribute\\tValue\" in lines[0]:\n",
        "        lines = lines[1:]\n",
        "\n",
        "    current_attribute = None\n",
        "    for line in lines:\n",
        "        line = line.strip() # Remove leading/trailing whitespace and newlines\n",
        "        if not line: # Skip empty lines\n",
        "            continue\n",
        "\n",
        "        # Check if the line contains a tab, indicating a new attribute-value pair start\n",
        "        if '\\t' in line:\n",
        "            parts = line.split('\\t', 1) # Split only on the first tab\n",
        "            attribute = parts[0].strip()\n",
        "            value = parts[1].strip() # Value part might be empty or actually contain the value\n",
        "\n",
        "            if value: # If value is on the same line\n",
        "                data[attribute] = value\n",
        "                current_attribute = None # Reset\n",
        "            else: # Attribute found, value expected on the next non-empty line\n",
        "                current_attribute = attribute\n",
        "        elif current_attribute is not None:\n",
        "            # This line is the value for the previously identified attribute\n",
        "            data[current_attribute] = line\n",
        "            current_attribute = None # Reset\n",
        "        # Lines that are neither an attribute start nor a value for a pending attribute are ignored\n",
        "\n",
        "    return data\n",
        "\n",
        "# --- Main execution in Colab ---\n",
        "\n",
        "# Define the directory where your NPD text files are located in Colab\n",
        "npd_txt_dir = '/content/npd_text_data/'\n",
        "\n",
        "# The directory should already exist and contain files from the previous block\n",
        "\n",
        "print(\"\\n--- Starting Parsing of NPD Summary Text Files (Super Revised - Final) ---\")\n",
        "\n",
        "# List of files to process\n",
        "npd_files = ['1_2-1.txt', '1_3-1.txt']\n",
        "\n",
        "all_well_data = []\n",
        "\n",
        "for filename in npd_files:\n",
        "    filepath = os.path.join(npd_txt_dir, filename)\n",
        "    if os.path.exists(filepath):\n",
        "        print(f\"\\nProcessing: {filename}\")\n",
        "        # Use the SUPER REVISED parsing function\n",
        "        well_info = parse_npd_summary_txt_super_revised(filepath)\n",
        "        all_well_data.append(well_info)\n",
        "\n",
        "        # Display some extracted info to confirm correct parsing\n",
        "        print(f\"  Wellbore Name: {well_info.get('Wellbore name', 'N/A')}\")\n",
        "        print(f\"  Content: {well_info.get('Content', 'N/A')}\")\n",
        "        print(f\"  Total Depth: {well_info.get('Total depth (MD) [m RKB]', 'N/A')}\")\n",
        "        print(f\"  1st HC Formation: {well_info.get('1st level with HC, formation', 'N/A')}\")\n",
        "    else:\n",
        "        print(f\"Error: File not found: {filepath}. This is unexpected if previous upload was successful.\")\n",
        "\n",
        "# Convert the list of dictionaries to a Pandas DataFrame for easier manipulation\n",
        "if all_well_data:\n",
        "    npd_df = pd.DataFrame(all_well_data)\n",
        "    print(\"\\n--- Consolidated NPD Well Data (DataFrame Head, Transposed) ---\")\n",
        "    print(npd_df.head().T)\n",
        "\n",
        "    consolidated_output_filename = 'npd_well_summaries_super_parsed.csv'\n",
        "    npd_df.to_csv(consolidated_output_filename, index=False)\n",
        "    print(f\"\\nConsolidated NPD well summaries saved to '{consolidated_output_filename}'\")\n",
        "else:\n",
        "    print(\"\\nNo NPD well data processed. Please re-check parsing logic or file content.\")"
