        "    # Well Name\n",
        "    match_well_name = re.search(r\"Well: (.+?) \\(Well Name\\)\", cleaned_text)\n",
        "    extracted_data[\"Well Name\"] = match_well_name.group(1).strip() if match_well_name else None\n",
        "\n",
        "    # Total Depth (more flexible to capture different phrasings for a single depth point)\n",
        "    match_total_depth = re.search(r\"(?:total depth of|encountered at|drilled to) (\\d+m) \\(Depth\\)\", cleaned_text, re.IGNORECASE)\n",
        "    extracted_data[\"Total Depth\"] = match_total_depth.group(1).strip() if match_total_depth else None\n",
        "\n",
        "    # Formation Name\n",
        "    match_formation_name = re.search(r\"the (.+?) Formation \\(Formation Name\\)\", cleaned_text, re.IGNORECASE)\n",
        "    if not match_formation_name: # Try a slightly different pattern if the first fails\n",
        "        match_formation_name = re.search(r\"(\\w+? \\w+? Formation) \\(Formation Name\\)\", cleaned_text, re.IGNORECASE)\n",
        "    extracted_data[\"Formation Name\"] = match_formation_name.group(1).strip() if match_formation_name else None\n",
        "\n",
        "    # Formation Interval Start and End (handles \"between X and Y\" and \"from X to Y\")\n",
        "    match_interval = re.search(r\"(?:between|from) (\\d+m) and (\\d+m) \\(Depth\\)\", cleaned_text, re.IGNORECASE)\n",
        "    extracted_data[\"Formation Interval Start\"] = match_interval.group(1).strip() if match_interval else None\n",
        "    extracted_data[\"Formation Interval End\"] = match_interval.group(2).strip() if match_interval else None\n",
        "\n",
        "    # Lithology (using findall to capture multiple instances)\n",
        "    # The non-greedy '.*?' is crucial here to stop at the next \"(Rock Type, Lithology)\"\n",
        "    # We also look for specific lead-in phrases\n",
        "    lithology_matches = re.findall(\n",
        "        r\"(?:(?:primarily consisted of|characterized by its|predominantly composed of|penetrated the|a highly fractured|unconsolidated|highly prospective) (.+?)) \\(Rock Type, Lithology\\)\",\n",
        "        cleaned_text, re.IGNORECASE\n",
        "    )\n",
        "    # Filter out empty strings and join unique lithologies, if any\n",
        "    extracted_data[\"Lithology\"] = [item.strip() for item in lithology_matches if item.strip()]\n",
        "    if not extracted_data[\"Lithology\"]:\n",
        "        extracted_data[\"Lithology\"] = None\n",
        "    else:\n",
        "        # Join multiple lithologies with a separator, or take the first if only one\n",
        "        extracted_data[\"Lithology\"] = \", \".join(list(set(extracted_data[\"Lithology\"]))) # Use set to get unique values\n",
        "\n",
        "    # Fluid Type (using findall for robustness, though usually one per report)\n",
        "    fluid_matches = re.findall(\n",
        "        r\"(?:presence of|indicating the presence of|showing minor|significant amounts of) (.+?) \\(Fluid Type\\)\",\n",
        "        cleaned_text, re.IGNORECASE\n",
        "    )\n",
        "    extracted_data[\"Fluid Type\"] = [item.strip() for item in fluid_matches if item.strip()]\n",
        "    if not extracted_data[\"Fluid Type\"]:\n",
        "        extracted_data[\"Fluid Type\"] = None\n",
        "    else:\n",
        "        extracted_data[\"Fluid Type\"] = \", \".join(list(set(extracted_data[\"Fluid Type\"])))\n",
        "\n",
        "    # Faults Mentioned / Fault Type\n",
        "    match_fault_mentioned = re.search(\n",
        "        r\"(No major faults \\(Faults\\))|(major reverse fault \\(Fault\\))|(significant strike-slip fault \\(Fault\\))|(No major structural anomalies, such as a fault \\(Fault\\))\",\n",
        "        cleaned_text, re.IGNORECASE\n",
        "    )\n",
        "    if match_fault_mentioned:\n",
        "        extracted_data[\"Faults Mentioned\"] = next((g.strip() for g in match_fault_mentioned.groups() if g is not None), None)\n",
        "    else:\n",
        "        extracted_data[\"Faults Mentioned\"] = None\n",
        "\n",
        "    match_fault_type = re.search(r\"(major reverse fault)|(significant strike-slip fault)\", cleaned_text, re.IGNORECASE)\n",
        "    if match_fault_type:\n",
        "        extracted_data[\"Fault Type\"] = next((g.strip() for g in match_fault_type.groups() if g is not None), None)\n",
        "    else:\n",
        "        extracted_data[\"Fault Type\"] = None\n",
        "\n",
        "\n",
        "    return extracted_data\n",
        "\n",
        "# --- Process all Mini Reports and store in a DataFrame using the refined function ---\n",
        "mini_report_data_refined = []\n",
        "mini_report_files = [f for f in os.listdir() if f.startswith('Mini Report') and f.endswith('.txt')]\n",
        "\n",
        "for file_name in sorted(mini_report_files):\n",
        "    file_path = file_name\n",
        "    with open(file_path, 'r') as f:\n",
        "        content = f.read()\n",
        "    extracted = extract_entities_from_mini_report_refined(content)\n",
        "    extracted['Report_Name'] = file_name\n",
        "    mini_report_data_refined.append(extracted)\n",
        "\n",
        "df_mini_reports_refined = pd.DataFrame(mini_report_data_refined)\n",
        "print(\"Extracted Data from Mini Reports (Refined):\")\n",
        "print(df_mini_reports_refined.to_string())"
