        "import re\n",
        "import pandas as pd\n",
        "import os\n",
        "from PyPDF2 import PdfReader\n",
        "\n",
        "# Re-use the extract_text_from_pdf function from previous step\n",
        "def extract_text_from_pdf(pdf_path):\n",
        "    text = \"\"\n",
        "    try:\n",
        "        reader = PdfReader(pdf_path)\n",
        "        for page_num in range(len(reader.pages)):\n",
        "            page = reader.pages[page_num]\n",
        "            page_text = page.extract_text()\n",
        "            if page_text:\n",
        "                text += page_text + \"\\n\"\n",
        "    except Exception as e:\n",
        "        print(f\"Error processing PDF {pdf_path}: {e}\")\n",
        "    return text\n",
        "\n",
        "def extract_entities_from_npd_pdf_refined(text_content):\n",
        "    \"\"\"\n",
        "    Extracts key-value pairs from NPD PDF text, differentiating between Wellbore and Discovery reports.\n",
        "    \"\"\"\n",
        "    data = {}\n",
        "    cleaned_text = clean_text(text_content) # Use the clean_text function for PDFs too\n",
        "    lines = cleaned_text.split('\\n')\n",
        "\n",
        "    # Determine report type\n",
        "    report_type = \"Unknown\"\n",
        "    if \"Wellbore / Exploration\" in cleaned_text or \"Wellbore name\" in cleaned_text:\n",
        "        report_type = \"Wellbore\"\n",
        "    elif \"Discovery\" in cleaned_text or \"Discovery name\" in cleaned_text:\n",
        "        report_type = \"Discovery\"\n",
        "\n",
        "    data[\"Report_Type\"] = report_type\n",
        "\n",
        "    if report_type == \"Wellbore\":\n",
        "        keywords = {\n",
        "            \"Wellbore Name\": r\"Wellbore name\\s*([^\\n]+)\",\n",
        "            \"Type\": r\"Type\\s*([^\\n]+)\",\n",
        "            \"Purpose\": r\"Purpose\\s*([^\\n]+)\",\n",
        "            \"Status\": r\"Status\\s*([^\\n]+)\",\n",
        "            \"Main Area\": r\"Main area\\s*([^\\n]+)\",\n",
        "            \"Field\": r\"Field\\s*([^\\n]+)\",\n",
        "            \"Discovery\": r\"Discovery\\s*([^\\n]+)\",\n",
        "            \"Drilling Operator\": r\"Drilling operator\\s*([^\\n]+)\",\n",
        "            \"Drilling Days\": r\"Drilling days\\s*(\\d+)\",\n",
        "            \"Total Depth (MD) [m RKB]\": r\"Total depth \\(MD\\) \\[m RKB\\]\\s*(\\d+\\.\\d+)\",\n",
        "            \"Content\": r\"Content\\s*([^\\n]+)\",\n",
        "            \"1st Level HC Age\": r\"1st level with HC, age\\s*([^\\n]+)\",\n",
        "            \"1st Level HC Formation\": r\"1st level with HC, formation\\s*([^\\n]+)\",\n",
        "            \"Water Depth [m]\": r\"Water depth \\[m\\]\\s*(\\d+\\.\\d+)\",\n",
        "            \"Bottom Hole Temperature [C]\": r\"Bottom hole temperature \\[C\\]\\s*(\\d+)\"\n",
        "        }\n",
        "        for key, pattern in keywords.items():\n",
        "            match = re.search(pattern, cleaned_text)\n",
        "            if match:\n",
        "                data[key] = match.group(1).strip()\n",
        "            else:\n",
        "                data[key] = None\n",
        "\n",
        "    elif report_type == \"Discovery\":\n",
        "        discovery_keywords = {\n",
        "            \"Discovery Name\": r\"Discovery name\\s*([^\\n]+)\",\n",
        "            \"Discovery Wellbore\": r\"Discovery wellbore\\s*([^\\n]+)\",\n",
        "            \"Discovery Year\": r\"Discovery year\\s*(\\d+)\",\n",
        "            \"Current Activity Status\": r\"Current activity status\\s*([^\\n]+)\"\n",
        "        }\n",
        "        for key, pattern in discovery_keywords.items():\n",
        "            match = re.search(pattern, cleaned_text)\n",
        "            if match:\n",
        "                data[key] = match.group(1).strip()\n",
        "            else:\n",
        "                data[key] = None\n",
        "\n",
        "        # Additionally, try to extract info from \"Wellbores - exploration\" table-like structure\n",
        "        # The structure looks like: \"Key\"\\n,\"Value\"\\n\n",
        "        wellbore_exploration_pattern = r\"Wellbores - exploration\\s*\\n\\n\\\"Wellbore name\\\"\\n,\\\"Entered\\n date\\\"\\n,\\\"Completed\\n date\\\"\\n,\\\"Purpose\\\"\\n,\\\"Status\\\"\\n,\\\"Content\\\"\\n\\n\\\"(.*?)\\\"\\n,\\\"([\\d.]+)\\\"\\n,\\\"([\\d.]+)\\\"\\n,\\\"(.+?)\\\"\\n,\\\"(.+?)\\\"\\n,\\\"(.+?)\\\"\"\n",
        "        match_wellbore_exp = re.search(wellbore_exploration_pattern, cleaned_text, re.DOTALL)\n",
        "        if match_wellbore_exp:\n",
        "            data[\"Exploration Wellbore Name\"] = match_wellbore_exp.group(1).strip()\n",
        "            data[\"Exploration Entered Date\"] = match_wellbore_exp.group(2).strip()\n",
        "            data[\"Exploration Completed Date\"] = match_wellbore_exp.group(3).strip()\n",
        "            data[\"Exploration Purpose\"] = match_wellbore_exp.group(4).strip()\n",
        "            data[\"Exploration Status\"] = match_wellbore_exp.group(5).strip()\n",
        "            data[\"Exploration Content\"] = match_wellbore_exp.group(6).strip()\n",
        "        else:\n",
        "            data[\"Exploration Wellbore Name\"] = None\n",
        "            # ... and so on for other exploration wellbore fields\n",
        "\n",
        "    return data\n",
        "\n",
        "# --- Process all NPD PDF Reports with the refined function ---\n",
        "npd_pdf_data_refined = []\n",
        "npd_pdf_files = [f for f in os.listdir() if f.endswith('.pdf') and f.startswith('1_')]\n",
        "\n",
        "for file_name in sorted(npd_pdf_files):\n",
        "    file_path = file_name\n",
        "    pdf_content = extract_text_from_pdf(file_path)\n",
        "    extracted = extract_entities_from_npd_pdf_refined(pdf_content)\n",
        "    extracted['Report_Name'] = file_name\n",
        "    npd_pdf_data_refined.append(extracted)\n",
        "\n",
        "df_npd_pdfs_refined = pd.DataFrame(npd_pdf_data_refined)\n",
        "# Reorder columns to put Report_Name first for better readability\n",
        "cols = ['Report_Name', 'Report_Type'] + [col for col in df_npd_pdfs_refined.columns if col not in ['Report_Name', 'Report_Type']]\n",
        "df_npd_pdfs_refined = df_npd_pdfs_refined[cols]\n",
        "print(\"\\nExtracted Data from NPD PDF Reports (Refined):\")\n",
        "print(df_npd_pdfs_refined.to_string())"
