        "import pandas as pd\n",
        "import matplotlib.pyplot as plt\n",
        "import seaborn as sns\n",
        "import os\n",
        "from sklearn.model_selection import train_test_split\n",
        "from sklearn.ensemble import RandomForestClassifier\n",
        "from sklearn.metrics import classification_report, accuracy_score\n",
        "from sklearn.preprocessing import StandardScaler # For scaling numerical features (good practice)\n",
        "\n",
        "# Define the expected filename\n",
        "well_log_file = 'synthetic_well_log_1.csv'\n",
        "\n",
        "try:\n",
        "    # --- Re-load and Re-process Data to ensure `integrated_features_df` is ready ---\n",
        "    if not os.path.exists(well_log_file):\n",
        "        print(f\"Error: The file '{well_log_file}' was not found in the current session.\")\n",
        "        raise FileNotFoundError(f\"File not found: {well_log_file}\")\n",
        "\n",
        "    well_log_df = pd.read_csv(well_log_file)\n",
        "    well_log_df.columns = well_log_df.columns.str.strip().str.lower()\n",
        "\n",
        "    gr_min = well_log_df['gr'].min()\n",
        "    gr_max = well_log_df['gr'].max()\n",
        "    if (gr_max - gr_min) == 0:\n",
        "        well_log_df['vshale'] = 0.0\n",
        "    else:\n",
        "        well_log_df['vshale'] = (well_log_df['gr'] - gr_min) / (gr_max - gr_min)\n",
        "\n",
        "    def classify_lithology(row):\n",
        "        if row['vshale'] > 0.6:\n",
        "            return 'Shale'\n",
        "        elif row['vshale'] < 0.2:\n",
        "            if row['npor'] > 0.1:\n",
        "                return 'Sandstone/Carbonate'\n",
        "            else:\n",
        "                return 'Tight Formation'\n",
        "        else:\n",
        "            return 'Mixed Lithology'\n",
        "    well_log_df['lithology'] = well_log_df.apply(classify_lithology, axis=1)\n",
        "\n",
        "    # Re-create integrated_features_df\n",
        "    integrated_features_df = well_log_df[['depth', 'gr', 'res', 'npor', 'vshale', 'lithology']].copy()\n",
        "\n",
        "    integrated_features_df['well_name'] = 'Synthetic_Well_A'\n",
        "    dominant_log_lithology = integrated_features_df['lithology'].mode()[0]\n",
        "    integrated_features_df['report_overall_lithology'] = f'Dominated by {dominant_log_lithology}'\n",
        "    integrated_features_df['report_fluid_indication'] = 'Hydrocarbon Show (Conceptual)'\n",
        "    integrated_features_df['report_fault_presence'] = 'No Major Faults (Conceptual)'\n",
        "\n",
        "    unique_lithologies = well_log_df['lithology'].unique() # Make sure this is defined\n",
        "    if 'Shale' in unique_lithologies and 'Sandstone/Carbonate' in unique_lithologies:\n",
        "        integrated_features_df['core_facies_type'] = integrated_features_df['lithology'].apply(\n",
        "            lambda x: 'Clean Sandstone Facies' if x == 'Sandstone/Carbonate' else 'Shale Facies'\n",
        "        )\n",
        "    elif 'Shale' in unique_lithologies:\n",
        "        integrated_features_df['core_facies_type'] = 'Shale Facies'\n",
        "    else:\n",
        "        integrated_features_df['core_facies_type'] = 'General Formation Facies'\n",
        "\n",
        "    print(\"Successfully re-processed data and created `integrated_features_df` for ML.\")\n",
        "\n",
        "    # --- Step 7: Machine Learning Model Development (Conceptual) ---\n",
        "    print(\"\\n--- Step 7: Machine Learning Model Development (Conceptual) ---\")\n",
        "    print(\"Objective: Predict lithology using integrated features.\")\n",
        "\n",
        "    # 7.1 Problem Formulation: Supervised Classification\n",
        "    print(\"\\n7.1 Problem Formulation: Predicting 'lithology' (Supervised Classification)\")\n",
        "\n",
        "    # 7.2 Feature Selection\n",
        "    # Features (X): Numerical well logs, engineered features, and conceptual categorical features\n",
        "    numerical_features = ['gr', 'res', 'npor', 'vshale']\n",
        "    categorical_features = ['core_facies_type'] # Using 'core_facies_type' as an example categorical feature\n",
        "\n",
        "    # Target Variable (Y): The 'lithology' column\n",
        "    target_variable = 'lithology'\n",
        "\n",
        "    # Select features and target from the integrated DataFrame\n",
        "    X = integrated_features_df[numerical_features + categorical_features]\n",
        "    y = integrated_features_df[target_variable]\n",
        "\n",
        "    print(f\"\\nSelected Features (X): {X.columns.tolist()}\")\n",
        "    print(f\"Selected Target Variable (y): {target_variable}\")\n",
        "\n",
        "    # 7.3 Data Preparation\n",
        "    print(\"\\n7.3 Data Preparation:\")\n",
        "\n",
        "    # One-hot encode categorical features\n",
        "    X_encoded = pd.get_dummies(X, columns=categorical_features, drop_first=True) # drop_first avoids dummy variable trap\n",
        "    print(\"\\nFeatures after One-Hot Encoding (X_encoded.head()):\")\n",
        "    print(X_encoded.head())\n",
        "\n",
        "    # Split data into training and testing sets\n",
        "    # Removed stratify=y to avoid error with single-sample classes\n",
        "    X_train, X_test, y_train, y_test = train_test_split(X_encoded, y, test_size=0.3, random_state=42)\n",
        "    print(f\"\\nData split into training ({len(X_train)} samples) and testing ({len(X_test)} samples) sets.\")\n",
        "    print(\"Training set dimensions (X_train):\", X_train.shape, \" (y_train):\", y_train.shape)\n",
        "    print(\"Testing set dimensions (X_test):\", X_test.shape, \" (y_test):\", y_test.shape)\n",
        "\n",
        "    # Optional: Feature Scaling for numerical features (important for some models like SVMs, neural networks)\n",
        "    # For RandomForest, it's less critical but good practice.\n",
        "    scaler = StandardScaler()\n",
        "    X_train_scaled = scaler.fit_transform(X_train)\n",
        "    X_test_scaled = scaler.transform(X_test)\n",
        "    print(\"\\nNumerical features scaled using StandardScaler.\")\n",
        "\n",
        "    # Convert scaled arrays back to DataFrames for easier inspection if needed (optional)\n",
        "    X_train_scaled_df = pd.DataFrame(X_train_scaled, columns=X_encoded.columns, index=X_train.index)\n",
        "    X_test_scaled_df = pd.DataFrame(X_test_scaled, columns=X_encoded.columns, index=X_test.index)\n",
        "    print(\"First 5 rows of scaled training features (X_train_scaled_df.head()):\")\n",
        "    print(X_train_scaled_df.head())\n",
        "\n",
        "\n",
        "    # 7.4 Model Choice: RandomForestClassifier\n",
        "    print(\"\\n7.4 Model Choice: Using RandomForestClassifier for conceptual demonstration.\")\n",
        "\n",
        "    # Initialize the model\n",
        "    model = RandomForestClassifier(n_estimators=100, random_state=42)\n",
        "\n",
        "    # 7.5 Conceptual Model Training & Evaluation\n",
        "    print(\"\\n7.5 Conceptual Model Training & Evaluation:\")\n",
        "\n",
        "    # Train the model (fit to the training data)\n",
        "    print(\"Training the RandomForestClassifier...\")\n",
        "    model.fit(X_train_scaled, y_train)\n",
        "    print(\"Model training complete.\")\n",
        "\n",
        "    # Make predictions on the test set\n",
        "    y_pred = model.predict(X_test_scaled)\n",
        "    print(\"\\nPredictions made on the test set.\")\n",
        "\n",
        "    # Evaluate the model\n",
        "    accuracy = accuracy_score(y_test, y_pred)\n",
        "    print(f\"\\nConceptual Model Accuracy: {accuracy:.4f}\")\n",
        "\n",
        "    print(\"\\nConceptual Classification Report:\")\n",
        "    # Ensure all labels in y_test are present in y_pred, or vice-versa for report\n",
        "    # If the synthetic data is too uniform, some labels might not appear in test set,\n",
        "    # or predictions for them might be 0, leading to warnings.\n",
        "    print(classification_report(y_test, y_pred, zero_division=0)) # zero_division=0 to suppress warnings for missing labels\n",
        "\n",
        "\n",
        "except FileNotFoundError as e:\n",
        "    print(f\"File handling error: {e}\")\n",
        "except Exception as e:\n",
        "    print(f\"An unexpected error occurred during ML model development: {e}\")\n",
        "\n",
        "print(\"\\nConceptual ML model development for lithology prediction complete.\")"
